import React, { useContext } from "react";
import NewExercise from "./Searchable";
import exerciseList from "./Exercise";
import { ExerciseContext } from "./App";

function NewExercisePage() {
    const { value, setValue, addNewExerciseCard } = useContext(ExerciseContext);

    return (
        <div>
            <NewExercise
                options={exerciseList}
                label="name"
                id="id"
                selectedVal={value}
                handleChange={(val) => setValue(val)}
                addNewExercise={addNewExerciseCard}
            />
        </div>
    );
}

export default NewExercisePage;
